import React, { Component } from 'react'

class RenderSkill extends Component {
    render() {
        return (
            <div>
                <h6 className="language-h6">Languages:</h6>
                        { renderLanguage }
                <h6>Frameworks:</h6>
                        { renderFramework }
                <h6>Databases:</h6>
                        { renderDatabase }
                <h6>Other:</h6>
                        { renderOther }
            </div>
        )
    }
}

export default RenderSkill
